let listCards  = [];
function initApp(){
    products.forEach((value, key) =>{
        let newDiv = document.createElement('div');
        newDiv.classList.add('item');
        newDiv.innerHTML = `
            <img src="image/${value.image}">
            <div class="title">${value.name}</div>
            <div class="price">$${value.price.toLocaleString()}</div>
            <button onclick="addToCard(${key})">Añadir</button>`;
        list.appendChild(newDiv);
    })
}
initApp();
function addToCard(key){
    if(listCards[key] == null){
        // copy product form list to list card
        listCards[key] = JSON.parse(JSON.stringify(products[key]));
        listCards[key].quantity = 1;
    }
    reloadCard();
}
function reloadCard(){
    listCard.innerHTML = '';
    let count = 0;
    let totalPrice = 0;
    listCards.forEach((value, key)=>{
        totalPrice = totalPrice + value.price;
        count = count + value.quantity;
        if(value != null){
            let newDiv = document.createElement('li');
            newDiv.innerHTML = `
                <div><img src="image/${value.image}"/></div>
                <div>${value.name}</div>
                <div>$${value.price.toLocaleString()}</div>
                <div>
                    <button onclick="changeQuantity(${key}, ${value.quantity - 1})">-</button>
                    <div class="count">${value.quantity}</div>
                    <button onclick="changeQuantity(${key}, ${value.quantity + 1})">+</button>
                </div>`;
                listCard.appendChild(newDiv);
        }
    })
    total.innerText = '$'+totalPrice.toLocaleString();
    quantity.innerText = count;
}
function changeQuantity(key, quantity){
    if(quantity == 0){
        delete listCards[key];
    }else{
        listCards[key].quantity = quantity;
        listCards[key].price = quantity * products[key].price;
    }
    reloadCard();
}

/* PDF Ticket */
document.querySelector('.total').addEventListener('click', generatePDF);

function generatePDF() {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

    // Recalcular totalPrice para asegurar que tenga el valor correcto
    let recalculatedTotal = 0;
    listCards.forEach((item) => {
        if (item != null) {
            recalculatedTotal += item.price;
        }
    });

    let yOffset = 10; // Espaciado vertical inicial
    doc.setFontSize(18);
    doc.text('Restaurante Mi Comida Favorita', 10, yOffset);
    yOffset += 10;

    // Fecha y hora
    let currentDate = new Date();
    let date = currentDate.toLocaleDateString();
    let time = currentDate.toLocaleTimeString();
    doc.setFontSize(12);
    doc.text(`Fecha: ${date} Hora: ${time}`, 10, yOffset);
    yOffset += 10;

    // Ubicación simulada
    doc.text('Ubicación: Calle Falsa 123, Ciudad', 10, yOffset);
    yOffset += 10;

    // Título de la lista
    doc.text('Artículos Comprados', 10, yOffset);
    yOffset += 10;

    // Lista de artículos
    listCards.forEach((item) => {
        if (item != null) {
            doc.text(`${item.name} - $${item.price.toLocaleString()} x${item.quantity}`, 10, yOffset);
            yOffset += 10;
        }
    });

    // Añadir la imagen atenuada a la derecha
    const imgData = 'data:image/png;base64,'; // Reemplaza con tu imagen base64 aquí
    doc.addImage(imgData, 'PNG', 140, 30, 50, 50, '', 'NONE', 0.2); // Opacidad 0.2 (atenuado)

    // Total recalculado
    doc.text(`Total: $${recalculatedTotal.toLocaleString()}`, 10, yOffset);

   // Formato para la fecha y hora para el nombre del archivo
   let dateTimeString = `${currentDate.getFullYear()}-${(currentDate.getMonth() + 1).toString().padStart(2, '0')}-${currentDate.getDate().toString().padStart(2, '0')}_${currentDate.getHours().toString().padStart(2, '0')}-${currentDate.getMinutes().toString().padStart(2, '0')}`;

   // Guardar el PDF con el nombre que incluye la fecha y la hora
   doc.save(`ticket_${dateTimeString}.pdf`);
}

document.querySelector('.closeShopping').addEventListener('click', clearCart);

function clearCart() {
    listCards = [];
    reloadCard();
}